export default (state = [], action) => {
	switch (action.type) {
		case 'INIT':
			return state;

		case 'LOAD_APPOINTMENT':
			return null;

		case 'LOAD_APPOINTMENT_FAILURE':
			return null;

		case 'LOAD_APPOINTMENT_SUCCESS':
			return action.payload;

		default:
			return state;
	}
};
